    const todoList = [
        {
            id: 1,
            title: 'Eat',
            status: 'new'
        },
        {
            id: 2,
            title: 'Sleep',
            status: 'completed'
        },
        {
            id: 3,
            title: 'Play',
            status: 'not yet'
        },
    ]
    return (
        <div>
            <h3>To Do List</h3>
            <Todolist props = {todoList} />
        </div>
    );
}

export default TodoFeature;
